      'writer' : '김자비',
      'regDate' : '2024-02-07'
    },
    {
      'boardNo' : 5,
      'title' : '5번 글',
      'content' : '5번 글 내용',
      'writer' : '유자바',
      'regDate' : '2024-02-08'
    }
  ];


  return (
    <div className="App">
        <div className='board-header'>

        </div>
    </div>
  );
}

export default App;
